import React from 'react'
import { Button } from 'antd';
import { connect } from 'react-redux'
import request  from '../../dataCal/dataCal'

class Feedback extends React.Component {

  //初始化
  state = {
      "studentID": '' ,
      "studentPassword": '' ,
      "studentMajor": '' ,
  };

  //更新接收信息状态
  componentWillReceiveProps(){
    let studentDataResult = request(this.props.studentID, this.props.studentPassword);
    this.setState({
      studentID: '',
      studentPassword: '',
      studentMajor: '',
      PA: studentDataResult.totalCreditOfPACourse,
    })
  }

  render() {

    //const { studentID, studentPassword, studentMajor } = this.props;
    return(
        <div>
          <p>你的学号是{this.props.studentID}</p>
          <p>你的专业是{this.props.studentMajor}</p>
          <p>你已经修读的总学分{this.props.studentMajor}</p>
          <p>你已经修读的军体类学分{this.state.PA}</p>
          <Button htmlType="button">生成报告</Button>
        </div>
    )
  }
}

const mapStateToProps = (state) =>{
  console.log(state);
  return{
    studentID: state.studentID,
    studentPassword: state.studentPassword,
    studentMajor: state.studentMajor,
  }
};
export default connect(mapStateToProps)(Feedback);
